      <form class="grid gap-2" autocomplete="off">
        <div class="grid gap-[2px]">
          <label for="email" class="font-medium text-[var(--teal12)]"
            >Email</label
          >
          <input
            placeholder="Enter your email"
            type="email"
            name="email"
            id="email"
            class="border-2 peer border-[var(--teal6)] text-[var(--teal11)] placeholder:text-[var(--sage11)] placeholder:text-sm hover:border-[var(--teal7)] transition duration-300 px-4 py-1.5 focus:outline-[var(--teal8)] rounded"
            required
          />
          <!-- <span class="invisible peer-invalid:visible text-rose-600"

            name@example.com</span
          > -->
        </div>
        <div class="grid gap-[2px]">
          <label for="password" class="font-medium text-[var(--teal12)]"
            >Password</label
          >
          <input
            placeholder="Enter your password"
            type="password"
            name="password"
            id="password"
            class="border-2 border-[var(--teal6)] placeholder:text-[var(--sage11)] text-[var(--teal11)] placeholder:text-sm hover:border-[var(--teal7)] transition duration-300 px-4 py-1.5 focus:outline-[var(--teal8)] rounded"
            required
          />
        </div>
        <button
          type="submit"
          class="py-2 mt-2 px-4 rounded text-[var(--sage1)] bg-[var(--teal9)] hover:bg-[var(--teal10)] transition duration-300"
        >
          Login
        </button>
        <p class="mt-2 text-center text-[var(--sage11)] text-sm">
          I am forgot my password ☹
        </p>
      </form>
